pragma solidity ^0.4.18;

import "./Rozet.sol";
import "./RozetToken.sol";
import "./SafeMath.sol";
import "./RozetTimelock.sol";

contract RozetGeneration {

  using SafeMath for uint256;

  address public founderOne;
  address public founderTwo;
  address public founderThree;
  address public partner;

  uint256 public weiRaised;
  uint256 public tokensSold;
  uint256 public cap;
  uint public rate;

  uint256 public roundOneStartDate;
  uint256 public roundTwoStartDate;
  uint256 public roundThreeStartDate;
  uint256 public roundFourStartDate;

  RozetToken public rozetToken;
  Rozet public rozet;

  event TokenPurchase(address indexed purchaser, address indexed beneficiary, uint256 value, uint256 amount);

  // "0x692a70d2e424a56d2c6c27aa97d1a86395877b3a", "0xFa9B0D8BB3e4cCdF443467C9eAF08f3b95420cB7", "0xFa9B0D8BB3e4cCdF443467C9eAF08f3b95420cB7", "0xFa9B0D8BB3e4cCdF443467C9eAF08f3b95420cB7", "0xFa9B0D8BB3e4cCdF443467C9eAF08f3b95420cB7" 
  function RozetGeneration(address _founderOne, address _founderTwo, address _founderThree, address _partner) public {

    // Create the RozetToken contract. RozetToken will automaticly transfer all tokens created to this RozetGeneration contract.
    rozetToken = new RozetToken();

    // Create the Rozet reputation database and ensure that it can only be used with offical Rozet tokens. 
    rozet = new Rozet(address(rozetToken));

    // Establish the addresses of each Rozet founder and partner.
    founderOne = _founderOne;
    founderTwo = _founderTwo;
    founderThree = _founderThree;
    partner = _partner;

    // Rate is approximatly 10c per Roz or 100 Roz per USD (assuming Ether is at $650). 
    // This translates to 152,358,055,378,460 wei per Rozet token. 
    rate = 152358055378460;

    // The maximum amount of ether to be raised is approximatly 20 million USD or 30k Ether (assuming %650 per ether).
    cap = 30000 ether;

    weiRaised = 0;

    uint timelockReleaseDate = now + 1 years;

    uint founderOneAllocation = (rozetToken.totalSupply() * 20 / 100) / 3;  // 6.6%
    uint founderTwoAllocation = (rozetToken.totalSupply() * 20 / 100) / 3;  // 6.6%
    uint founderThreeAllocation = (rozetToken.totalSupply() * 20 / 100) / 3;  // 6.6%
    uint partnerAllocation = (rozetToken.totalSupply() * 10 / 100);  // 10%
    // Lock the founder's and partner's tokens for one year in a seperate contract.
    RozetTimelock rozetTimelock = new RozetTimelock(rozetToken, founderOne, founderOneAllocation, founderTwo, founderTwoAllocation, founderThree, founderThreeAllocation, partner, partnerAllocation, timelockReleaseDate);
    rozetToken.transfer(rozetTimelock, founderOneAllocation + founderTwoAllocation + founderThreeAllocation + partnerAllocation);


    // TODO lock 10% of tokens forever 

  }

  function () external payable {
    buyTokens(msg.sender);
  }

  function buyTokens(address _beneficiary) public payable {

    uint256 weiAmount = msg.value;

    require(_beneficiary != address(0));
    require(weiAmount != 0);
    require(weiRaised.add(weiAmount) <= cap);

    // The rate, or price of Roz, is discounted for early rounds.
    uint256 round = getRound();

    // Figure out how much of a discount bonus is to be given.
    uint bonus = getBonus(round);

    // Appply the bonus to the rate.
    uint currentRate = rate;
    currentRate = rate + (rate * bonus / 100);

    uint256 tokens = weiAmount.mul(currentRate);

    weiRaised = weiRaised.add(weiAmount);

    tokensSold += tokens;

    rozetToken.transfer(_beneficiary, tokens);

    TokenPurchase(msg.sender, _beneficiary, weiAmount, tokens);

  }

  function getRound() public view returns (uint256) {
    // The round is advanced when that rounds end date is reached or that rounds sale cap is reached, which ever comes first. 

    // Determine what round we could in based on the current date.
    uint roundBasedOnTime;
    if (now < roundTwoStartDate) {
      roundBasedOnTime = 1;
    }
    else if (now < roundTwoStartDate) {
      roundBasedOnTime = 2;
    }
    else if (now < roundThreeStartDate) {
      roundBasedOnTime = 3;
    }
    else {
      roundBasedOnTime = 4;
    }

    // TODO change this to amount of wei raised not tokens sold
    // Determine what round we could be in based on the number of Roz tokens sold.
    uint roundBasedOnTokensSold;
    // If we have sold fewer than 20 percent of tokens we are in round one.
    if (tokensSold <= 20) {
      roundBasedOnTokensSold = 1;
    }
    else if (tokensSold <= 30) {
      roundBasedOnTokensSold = 2;
    }
    else if (tokensSold <= 40) {
      roundBasedOnTokensSold = 3;
    }
    else {
      roundBasedOnTokensSold = 4;
    }

    uint round;
    // The acutal round is the larger of the two possible rounds.
    if (roundBasedOnTokensSold > roundBasedOnTime) {
      round = roundBasedOnTokensSold;
    } else {
      round = roundBasedOnTime;
    }

    return round;
  }

  function getBonus(uint round) public pure returns (uint) {
    // Determine the bonus given to early rounds.
    uint bonus;
    // If this is round one then you get a 30% bonus.
    if (round == 1) {
      bonus = 30;
    }
    // If this is round two then you get a 20% bonus.
    else if (round == 2) {
      bonus = 20;
    }
    // Round 3 gets a 10% bonus.
    else if (round == 3) {
      bonus = 10;
    }
    // Round 4 gets no bonus.
    else {
      bonus = 0;
    }
  }

  function capReached() public view returns (bool) {
    return weiRaised >= cap;
  }

  function withdraw() public {
    uint amountToSend = this.balance / 3;
    founderOne.transfer(amountToSend);
    founderTwo.transfer(amountToSend);
    founderThree.transfer(amountToSend);
  }


}
